import React from 'react'
import styled from 'styled-components';

function OverviewButton() {
  function handleClick(e) {
    e.preventDefault();
    console.log('The link was clicked.');
  }

  return (
    <a href="#" onClick={handleClick}>
      Click me
    </a>
  );
}

export default OverviewButton;
